import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import Root from '../components/Root/Root.jsx';
import Navigation from './Navigation/Navigation.jsx';
import UsersCRUD from '../components/Pages/Users/UsersCRUD.jsx';
import CreateUser from '../components/Pages/Users/CRUD/C/UserCreate.jsx';
import ReadUsers from '../components/Pages/Users/CRUD/R/UserRead.jsx';
import UserDetails from '../components/Pages/Users/CRUD/R/UserShow.jsx';
import MoviesCRUD from '../components/Pages/Movies/MoviesCRUD.jsx';
import RentsCRUD from '../components/Pages/Rents/RentsCRUD.jsx';

const router = createBrowserRouter([
  { 
    path: '/', 
    element: <Navigation />, 
    children: [
      { path: 'users', element: <UsersCRUD />, 
        children: [
          { path: 'create', element: <CreateUser /> },
          { path: 'read', element: <ReadUsers /> },
          { path: 'showUser/:id', element: <UserDetails /> }
        ]
      },
      { path: 'movies/*', element: <MoviesCRUD /> },
      { path: 'rents/*', element: <RentsCRUD /> }
    ]
  }
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
